CREATE VIEW vw_Brandenburger_Struktur AS
SELECT Land_ID, Region_ID, Kreis_ID, Gemeinde_ID, Ortsteil_ID, Land, Kreis, Gemeinde, Ort, count(*) AS Anzahl
FROM Brandenburg
GROUP BY Land_ID, Region_ID, Kreis_ID, Gemeinde_ID, Ortsteil_ID, Land, Kreis, Gemeinde, Ort;

CREATE VIEW vw_Brandenburger_Kreise
AS
Select DISTINCT a.Land_ID, a.Kreis_ID, a.Land, a.Kreis, 'kreisfreie Stadt' AS Art
FROM Brandenburg a
WHERE NOT EXISTS (SELECT * 
                  FROM Brandenburg b
				  WHERE b.Land_ID = a.Land_ID AND b.Kreis_ID = a.Kreis_ID AND
				        b.Gemeinde_ID <> 0)

UNION

Select DISTINCT a.Land_ID, a.Kreis_ID, a.Land, a.Kreis, 'Landkreis' AS Art
FROM Brandenburg a
WHERE EXISTS (SELECT * 
              FROM Brandenburg b
			  WHERE b.Land_ID = a.Land_ID AND b.Kreis_ID = a.Kreis_ID AND
			        b.Gemeinde_ID <> 0);

/* -------------------------------------------------------------------------------- **
**   Erzeugen einer Sicht der Brandenburger Gemeinden 
** -------------------------------------------------------------------------------- */
CREATE VIEW vw_Brandenburger_Gemeinden 
AS
SELECT DISTINCT a.Land_ID, a.Kreis_ID, a.Gemeinde_ID, a.Land, a.Kreis, a.Gemeinde, 'Gemeinde' AS Art
FROM Brandenburg a
WHERE NOT EXISTS (SELECT * 
                  FROM Brandenburg_Staedte b 
				  WHERE b.Land_ID = a.Land_ID AND b.Kreis_ID = a.Kreis_ID AND b.Gemeinde_ID = a.Gemeinde_ID)

UNION

SELECT DISTINCT a.Land_ID, a.Kreis_ID, a.Gemeinde_ID, a.Land, a.Kreis, a.Gemeinde, 'Stadt' AS Art
FROM Brandenburg a
WHERE EXISTS (SELECT * 
              FROM Brandenburg_Staedte b 
			  WHERE b.Land_ID = a.Land_ID AND b.Kreis_ID = a.Kreis_ID AND b.Gemeinde_ID = a.Gemeinde_ID);









